import React, {Component} from 'react';
import Config from "../scripts/config";
import {Row,Col, Container, Button} from "react-bootstrap";
import Slider, { createSliderWithTooltip } from 'rc-slider';
import 'rc-slider/assets/index.css'




class Rossrv extends Component {
  state = {ros: null,
          speed: 1,
          force:5,
          pose:0
              };

  constructor(props){
    super(props);

    }
  log(value) {
        console.log(value); //eslint-disable-line
      }

  onSliderChange = value => {
    this.log(value);
    this.setState({ value });
  };
  onAfterChange = value => {
      console.log(value); //eslint-disable-line
  };
  // create a pose subscriber
  init_connection(){
    console.log("Establish map connection");

      try{
        this.state.ros = new window.ROSLIB.Ros();
        this.state.ros.connect(
          "ws://"+Config.ROSBRIDGE_SERVER_IP+":"+Config.RSOBRIDGE_PORT+""
        );
        console.log("In map components");
      }catch(error) {
        console.log("Connection problem in map components");
      }
    }

 componentDidMount(){
      this.init_connection();
    }

  onSpeedSliderChange = speed => {
        this.log(speed);
        this.setState({
          speed,
        });
      };

  onPoseSliderChange = pose => {
            this.log(pose);
            this.setState({
              pose,
            });
          };

onForceSliderChange = force => {
          this.log(force);
          this.setState({
            force,
          });
        };
render() {
      return (
        <Container>
         <Slider>
        value={this.state.speed}
        onChange={this.onSpeedSliderChange}
        onAfterChange={this.onAfterChange}
        </Slider>
        <Slider>
       value={this.state.pose}
       onChange={this.onPoseSliderChange}
       onAfterChange={this.onAfterChange}
       </Slider>
       <Slider >
      value={this.state.force}
      onChange={this.onForceSliderChange}
      onAfterChange={this.onAfterChange}
      </Slider>
      </Container>
  );
      }
}
export default Rossrv;
